import 'react-native-gesture-handler';
import React, {Component,useState} from 'react';
import {Button, Image, StyleSheet, Text, TouchableOpacity, View } from 'react-native';
import * as ImagePicker from 'expo-image-picker';
import ImgToBase64 from 'react-native-image-base64';
import ImageEditor from "@react-native-community/image-editor";
import { Asset } from 'expo-asset';
import * as FileSystem from 'expo-file-system';
import { TextInput } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Modal from 'react-native-modal';

const Clarifai = require('clarifai');



/////////////////////////////////////////////////////////////////////
function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Image source={{ uri: 'data:image/png;base64,' }} style={styles.logo} />
      <Text>Select Pieces That You Already Have</Text>
      <Button
        title="Add Clothing to Inventory"
        onPress={() => navigation.navigate('Add to Closet')}
      />
      <Text> </Text>
      <Text> </Text>
      <Text> </Text>
      <Text>What's Your Personal Cost Per Use of This Item?</Text>
      <Button
        title="Should I Buy This?"
        onPress={() => navigation.navigate('Search')}
      />
      <Text> </Text>
       <Text> </Text>
      <Image source={{ uri: 'data:image/png;base64,' }} style={styles.logo} />
      
    </View>
  );
}

const app = new Clarifai.App({
 apiKey: 'd6ddbeda3e934d8eb67d2e8b241ef227'
});


/////////////////////////////////////////////////////////////
function Details({ navigation }) {
  var [text, setText] = useState('');
    
 
  let [selectedImage, setSelectedImage] = React.useState(null);

  let openImagePickerAsync = async () => {
    let permissionResult = await ImagePicker.requestCameraRollPermissionsAsync();

    if (permissionResult.granted === false) {
      alert('Permission to access camera roll is required!');
      return;
    }

    let pickerResult = await ImagePicker.launchImageLibraryAsync();
    if (pickerResult.cancelled === true) {
      return;
    }

    setSelectedImage({ localUri: pickerResult.uri });
     const picbase64 = await FileSystem.readAsStringAsync(pickerResult.uri, { encoding: 'base64' });
    
   
 app.inputs.create({
  base64: picbase64,
  metadata:{key:text}

  
  
  
})

}


  


  if (selectedImage !== null) {
     
    return (
      <View style={styles.container}>
      <Text style={styles.instructions}>  Item Added! </Text>
      
        <Image source={{ uri: selectedImage.localUri }} style={styles.thumbnail} />
       <Text></Text>
     
     
      
      <Button
        title="Back"
        onPress={() => navigation.navigate('Home')}
      />

      </View>
    );
   
  }
  

  return (
    <View style={styles.container}>
    <Text style={styles.instructions}>Step 1</Text>
    <TextInput
        style={{height: 40}}
        placeholder="How often do you wear this item in a year?"
        onChangeText={text => setText(text)}
        defaultValue={text}
        returnKeyType = "go"
        
      />
     
      <Text style={styles.instructions}>
       Step 2
      </Text>

      <TouchableOpacity onPress={openImagePickerAsync} style={styles.button}>
        <Text style={styles.buttonText}>Select Image of Item</Text>
      </TouchableOpacity>
      
       
    </View>
  );
   
}


///////////////////////////////////////////////////
function Search({ navigation }) {
  const [cost,total, setText] = useState('');
  var [text1, setText1] = useState('');
  var ACPRfinal = 0;
   var count = 0;
  var count1 = 0;
  var array = [];
  let [selectedImage, setSelectedImage] = React.useState(null);

  let openImagePickerAsync = async () => {
    let permissionResult = await ImagePicker.requestCameraRollPermissionsAsync();

    if (permissionResult.granted === false) {
      alert('Permission to access camera roll is required!');
      return;
    }

    let pickerResult = await ImagePicker.launchImageLibraryAsync();
    if (pickerResult.cancelled === true) {
      return;
    }

    setSelectedImage({ localUri: pickerResult.uri });
     const picbase64 = await FileSystem.readAsStringAsync(pickerResult.uri, { encoding: 'base64' });
    

   
 app.inputs.search({
   input:{
  base64: picbase64,
   }

  
  
  
}).then(
  function(response) {
    response.hits.map(
    (hit) => {
      
      
      count = parseInt(hit.input.data.metadata.key);
      array.push(count);
      
      count1 = count+count1;
      
      
      }
      
     
      
  )
  console.log(text1);
  console.log(count1);
  console.log(array.length);
  var times = (count1/(array.length));
  
  console.log(times);
  
  var ACPR = (text1/times);
  ACPRfinal = ACPR.toFixed(2)
  console.log(ACPRfinal);
  alert("The cost per wear (one year of use) of this item is about $"+ACPRfinal);
 
  
  },
  function(err) {
    // there was an error
  }
  
 
);


}


  
  
  
  

   if (selectedImage !== null) {
     
    return (
      <View style={styles.container}>
      <Text style={styles.instructions}>  Item Added! </Text>
      
        <Image source={{ uri: selectedImage.localUri }} style={styles.thumbnail} />
       <Text></Text>
     
      <Text style={styles.instructions}> Calculating Cost Per Wear... </Text>
      
      <Button
        title="Back"
        onPress={() => navigation.navigate('Home')}
      />
    

      </View>
    );
  
  }
  

  return (
    <View style={styles.container}>
    <Text style={styles.instructions}>Step 1</Text>
    <TextInput
        style={{height: 40}}
        placeholder="Cost?"
        onChangeText={text1 => setText1(text1)}
        defaultValue={text1}
        returnKeyType = "go"
        
      />
      
      <Text style={styles.instructions}>
       Step 2
      </Text>

      <TouchableOpacity onPress={openImagePickerAsync} style={styles.button}>
        <Text style={styles.buttonText}>Select Image of Item</Text>
      </TouchableOpacity>
      
       
    </View>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 305,
    height: 159,
    marginBottom: 20,
  },
  instructions: {
    color: '#888',
    fontSize: 18,
    marginHorizontal: 15,
    marginBottom: 10,
  },
  button: {
    backgroundColor: 'blue',
    padding: 20,
    borderRadius: 5,
  },
  buttonText: {
    fontSize: 20,
    color: '#fff',
  },
  thumbnail: {
    width: 300,
    height: 300,
    resizeMode: 'contain',
  },
});
const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="Add to Closet" component={Details} />
        <Stack.Screen name="Search" component={Search} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;